import Login from '../containers/Login';
import Register from '../containers/Register';
import Home from '../containers/Home';

export default [
    {
        path: '/login',
        name: 'login',
        component: Login,
    },
    {
        path: '/register',
        name: 'register',
        component: Register,
    },
    {
        path: '/home',
        name: 'home',
        component: Home,
        children: [],
    },
];
